import React, { Component } from "react";

class Welcome extends Component {
  render() {
    return (
      <div className="text-center">
        <img src="https://drive.google.com/file/d/1CuqfcbIl1layt5nVOwe5fuiy6TrwkO9J/view" className="img-responsive" />
        <h2>Welcome</h2>
      </div>
    );
  }
}

export default Welcome;
